import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { FaGraduationCap, FaCertificate, FaHeart, FaShieldAlt, FaUserMd, FaAward } from 'react-icons/fa';

const About = () => {
  const qualifications = [
    {
      icon: <FaGraduationCap className="w-6 h-6" />,
      title: "Licensed Practical Nurse (LPN)",
      description: "Registered healthcare professional with comprehensive medical training"
    },
    {
      icon: <FaCertificate className="w-6 h-6" />,
      title: "Advanced Foot Care Nurse (AFCN)",
      description: "Specialized certification in advanced foot care and treatment"
    },
    {
      icon: <FaAward className="w-6 h-6" />,
      title: "Continuing Education",
      description: "Ongoing professional development in latest foot care techniques"
    }
  ];

  const values = [
    {
      icon: <FaHeart className="w-8 h-8" />,
      title: "Comfort",
      description: "We prioritize your comfort throughout every treatment, ensuring a relaxing and pain-free experience."
    },
    {
      icon: <FaShieldAlt className="w-8 h-8" />,
      title: "Wellness",
      description: "Our holistic approach focuses on overall foot health and wellness, not just treating symptoms."
    },
    {
      icon: <FaUserMd className="w-8 h-8" />,
      title: "Professionalism",
      description: "We maintain the highest standards of professional care with evidence-based treatment methods."
    }
  ];

  return (
    <div className="min-h-screen bg-white">
      {/* Hero Section */}
      <section className="bg-gradient-to-br from-primary to-secondary text-white py-16">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="text-center mb-8">
            <motion.h1
              initial={{ opacity: 0, y: -20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
              className="text-4xl md:text-5xl font-bold mb-4"
            >
              About Me
            </motion.h1>
          </div>
        </div>
      </section>

      {/* Qualifications */}
      <section className="py-16 bg-white">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="text-center mb-12">
            <h2 className="text-3xl md:text-4xl font-bold text-text mb-4">
              Professional Qualifications
            </h2>
            <p className="text-lg text-gray-600 max-w-2xl mx-auto">
              Sima brings extensive training and certification to provide you with the highest quality foot care
            </p>
          </div>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            {qualifications.map((qual, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                className="text-center p-6 bg-accent rounded-lg"
              >
                <div className="text-primary mb-4 flex justify-center">
                  {qual.icon}
                </div>
                <h3 className="text-xl font-semibold text-text mb-3">
                  {qual.title}
                </h3>
                <p className="text-gray-600">
                  {qual.description}
                </p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Mission & Values */}
      <section className="py-16 bg-accent">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="text-center mb-12">
            <h2 className="text-3xl md:text-4xl font-bold text-text mb-4">
              Our Mission & Values
            </h2>
            <p className="text-lg text-gray-600 max-w-3xl mx-auto">
              At Feet First Foot Care & Wellness Clinic, we are committed to providing exceptional 
              foot care services that prioritize your comfort, wellness, and overall health.
            </p>
          </div>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            {values.map((value, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                className="bg-white rounded-lg p-8 text-center shadow-md"
              >
                <div className="text-primary mb-4 flex justify-center">
                  {value.icon}
                </div>
                <h3 className="text-xl font-semibold text-text mb-4">
                  {value.title}
                </h3>
                <p className="text-gray-600">
                  {value.description}
                </p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* About Me Content */}
      <section className="py-16 bg-white">
        <div className="max-w-4xl mx-auto px-4 sm:px-6 lg:px-8">
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            className="prose prose-lg max-w-none"
          >
            <div className="space-y-6 text-gray-700 leading-relaxed">
              <p>
                My name is Sima Kukadiya, and I am a dedicated Foot Care Nurse with over 15 years of 
                nursing experience. Throughout my career, I have had the privilege of caring for individuals 
                in a variety of clinical settings, which has strengthened my commitment to compassionate, 
                client and family centered care. Over the years, I developed a deep passion for foot health, 
                recognizing how essential healthy, comfortable feet are for mobility, independence, and 
                overall quality of life. I also observed a growing need for proper foot care among seniors, 
                where timely, professional care can greatly improve comfort, independence, and long-term 
                wellness.
              </p>
              <p>
                As a Foot Care Nurse, I combine my extensive nursing background with specialized foot care 
                training to provide safe, gentle, and evidence-based treatment. I take great pride in creating 
                a welcoming, supportive, and non-judgmental environment where clients feel comfortable 
                and confident receiving care. My approach focuses not only on addressing current concerns, 
                but also on education, prevention, and long-term foot health management.
              </p>
              <p>
                I believe every client deserves individualized care, and I strive to ensure each assessment 
                and treatment is performed with professionalism, respect, and attention to detail. Helping 
                clients maintain healthy feet—so they can stay active, independent, and enjoy life to the 
                fullest—is what inspires and motivates my work every day.
              </p>
            </div>
          </motion.div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="py-16 bg-primary text-white">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 text-center">
          <h2 className="text-3xl md:text-4xl font-bold mb-4">
            Ready to Experience Professional Foot Care?
          </h2>
          <p className="text-xl mb-8 max-w-2xl mx-auto">
            Schedule your appointment today and take the first step towards healthier, happier feet.
          </p>
          <Link
            to="/book-appointment"
            className="bg-white text-primary px-8 py-3 rounded-full font-semibold hover:bg-accent transition-colors inline-block"
          >
            Book Your Appointment
          </Link>
        </div>
      </section>
    </div>
  );
};

export default About;
